交势力后花园，玩尽心计争夺之余，和家族好友聊尽日常，闲情琐事，享受玩游戏交朋友的轻松愉快。\n\n\nNPC拉拢亲疏有度 权谋手腕尽显权贵风范\n\n与原著中NPC互动，展示你卓越的撩妹、撩汉技能。略施小小的权谋，晋升权贵，获得专属特权，宫廷晋升之路平步青云。\n\n\n多分支开放剧情 结局命运由自己掌控\n\n多分支开放式剧情，结局任你改写，不再纠结于既定的结局，自己主导剧情走向，将人物命运掌握在自己手中。携上闺蜜好友，大家来一场不带剧本的邂逅吧。\n\n\n【联系我们】\n如果您在游戏中遇到任何问题，或者想要提供宝贵意见，可通过以下方式联系我们：\n\n客服QQ公众号：800057851\n京门风月微信公众：京门风月手游\n京门风月新浪微博：京门风月手游','abbe042093dfdf1b5fc54375be20150c','2017-03-31 10:00:22',NULL),(6401,6403,'少年西游记－西游卡牌王者之作','https://itunes.apple.com/app/id1104855278',NULL,'','387fce5ccb4cdd4bf3cab9770355dae7','2017-03-31 10:00:22','2017-04-04 08:45:12'),(6402,6404,'Yandex Browser for iPad — fast and secure browser','https://itunes.apple.com/us/app/id574939428',NULL,'','65ca1b18fbf0fb31e53f4ba3b202f490','2017-03-31 10:00:22','2017-04-03 09:00:12'),(6403,6405,'GoEuro: trains, buses, flights','https://play.google.com/store/apps/details?id=com.goeuro.rosie',NULL,'Trending Pop','94aa05b1347c52d02de309fdd5f19aba','2017-03-31 10:00:22','2017-04-04 08:30:12'),(6404,6406,'DONGXii','http://itunes.apple.com/app/id1130926936',NULL,'DONGXii is a Berlin-based online shop and lifestyle magazine for local quality products from Germany and Northern Europe.','e2fc429cae6e068c8d991f0f91b272d9','2017-03-31 10:00:22',NULL),(6405,6407,'Genies &amp; Gems','http://itunes.apple.com/app/id1032443533',NULL,'','578b024d55de9dba455b977f8a2342ec','2017-03-31 10:00:22','2017-03-31 12:00:12'),(6406,6408,'Club Penguin_iOS_CA_CPI_INCENT CD7474','https://itunes.apple.com/ca/app/club-penguin-island/id991869606',NULL,'Where your adventures begin!Discover a destination full of secrets and\nmyths, legendary treasures, and piñata smashing penguins! On DISNEY\'S\nClub Penguin Island, you can waddle around with friends, level-up, and\nquest for special rewards.JOIN A THRIV','657132ea81ac58f316e61df37b8614b1','2017-03-31 10:00:22',NULL),(6407,6409,'Fishdom_iOS_CA/UK_CPI CD8526','https://itunes.apple.com/us/app/id664575829',NULL,'','b6bd5597aa3c3d127a5c20aba96815cd','2017-03-31 10:00:22','2017-04-03 08:00:12'),